import React from 'react'

const arr = [
  {
    name: "sonam",
    city: "nagpur",
  },
  {
    name: "vikash",
    city: "delhi",
  },
  {
    name: "bittu",
    city: "kolkata",
  },
];

export default function App() {
    const [data, setData] = useState(arr);
    
    return (
        <div>
            {
                arr.map(ele=>(
                    <div>
                        <h1>{ele.name}</h1>
                      <h1>{ele.city}</h1>
                    </div>
                )
                )
            }
        </div>
    )
}
